import pic from './Apple-12.jpg';
function Cart() {
    return ( 
       <table className="table table-success table-striped">
           <tr>
               <th>Image</th>
               <th>Product</th>
               <th>Quantity</th>
               <th>Price</th>
           </tr>
           <tr></tr>
       </table>
     );
}

export default Cart;
